import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Endereco } from './endereco';

@Injectable({
  providedIn: 'root'
})
export class EnderecoService {
  pdateEndereco(id: number, endereco: Endereco) {
    throw new Error('Method not implemented.');
  }
  getEnderecoById(id: number) {
    throw new Error('Method not implemented.');
  }

 private baseURL = "http://localhost:8080/api/vfinal/endereco";

  constructor(private httpClient: HttpClient ) { }

getEnderecosList(): Observable<Endereco[]>{
  return this.httpClient.get<Endereco[]>(`${this.baseURL}`);
}

createEndereco(endereco: Endereco): Observable<Object>{
  return this.httpClient.post(`${this.baseURL}`, endereco);
}

updateEndereco(id: number, militar: Endereco): Observable<Object>{
  return this.httpClient.put(`${this.baseURL}/${id}`, militar);
}

getEnderecoByid(id: number): Observable<Endereco>{
  return this.httpClient.get<Endereco>(`${this.baseURL}/${id}`);
}

deleteEndereco(id: number): Observable<Object>{
  return this.httpClient.delete(`${this.baseURL}/${id}`)
}

}
